import React from 'react';
import './App.css';
import HomePage from './pages/homepage.component';
import { Route, Routes  } from 'react-router-dom';
function App() {
  return (

    <div className="App">
        <HomePage/>
        <Routes>
          <Route exact path='/' component={HomePage} />
          <Route />
        </Routes>
    </div>
  );
}

export default App;
